const e={title:"Introducción al Rol de Engineering Manager",speaker:[{image:"miguel-garcia.jpg",name:"Miguel García Lorenzo",link:"https://www.linkedin.com/in/mgarlorenzo/"},{image:"lucia-perez.jpg",name:"Lucia Pérez Fernández",link:"https://www.linkedin.com/in/luc%C3%ADa-p%C3%A9rez-fern%C3%A1ndez-2279a177/"}],description:["Este taller te proporcionará un viaje dinámico y divertido a través de la gestión de equipos de ingeniería, ofreciendo conocimientos teóricos y prácticos que te ayudarán a descubrir el rol de Engineering Manager y afrontar los retos del día a día si decides tomar este camino profesional.","El viaje comienza con una introducción en la que se abordan los primeros pasos para posteriormente  avanzar hacia temas más interesantes como One-to-One, resolución de problemas o liderazgo. La última parada de este viaje nos llevará a visitar partes menos actractvias del rol como pueden ser abordar situaciones de bajo rendimiento en el equipo o la salud mental del propio manager.","¡Súbete y disfruta del viaje!"],schedule:"Viernes 12:00-14:00",track:"Management",twitter:["https://twitter.com/phpulpocon/status/1676947064109019138","https://twitter.com/phpulpocon/status/1678660514036043776"]},a={title:"Arquitectura en la nube con bridas y cinta americana",speaker:[{image:"anastasia.jpg",name:"Anastasia Kondratieva",link:"https://twitter.com/AnastasiaKnt"}],description:["En este taller vamos a hacernos una pregunta ¿qué harías si tuvieras que montar la infraestructura de una empresa entera desde cero en AWS? Planificaremos la arquitectura, mezclaremos el cemento, levantaremos las paredes...y porque no, usaremos un poco de cinta americana aquí y allá para disimular desperfectos. Será un viaje interactivo en el que lxs participantes votarán sobre los caminos que vamos a ir tomando y hablaremos de las consecuencias de nuestras decisiones."],schedule:"Viernes 16:00-18:00",track:"DevOps",twitter:["https://twitter.com/phpulpocon/status/1667565373003104259"]},t={title:"Agua, Aire, Tierra y Fuego",speaker:[{image:"mavi.jpg",name:"Mavi Jimenez",link:"https://twitter.com/linkita"}],description:["La parte más complicada a la hora de hacer funcionar un proyecto, es la comunicación y las relaciones entre las personas. ¿Realmente debemos tratar a los demás como nos gusta que nos traten a nosotros?","En este taller, exploraremos en profundidad los diversos tipos de personas que pueden conformar un equipo, incluyéndonos a nosotras mismas, y aprenderemos cómo establecer relaciones efectivas con cada una de ellas. Descubriremos qué aspectos observar, cómo acercarnos de manera adecuada y cómo interpretar las sutilezas de cada tipo de interacción. Para lograr este propósito, nos apoyaremos en DISC, una poderosa herramienta de autoconocimiento y comprensión del entorno, que nos brindará la capacidad de construir puentes entre los diferentes elementos."],schedule:"Viernes 9:30-11:30",track:"Management",twitter:["https://twitter.com/phpulpocon/status/1668313122451468289"]},i={title:"Taller de reliability testing con Grafana k6",speaker:[{image:"imma-valls.jpg",name:"Imma Valls",link:"https://twitter.com/eyeveebee"}],description:["Grafana k6 (http://k6.io) es una herramienta de código abierto inicialmente diseñada para la realización de pruebas de carga y rendimiento. Es especialmente útil para developers y SREs (Site Reliability Engineers) que deseen evaluar y analizar el desempeño de sus aplicaciones.","k6 destaca por un alto rendimiento (desarrollada en Go), el enfoque basado en código (las pruebas se scriptan en Javascript ES6), gran facilidad para automatizar (CLI e integraciones con CI/CD), soporte para múltiples protocolos, flexibilidad en el almacenamiento y visualización de métricas.","En este taller práctico comprobarás cómo k6 puede ayudarte no solo a con el rendimiento, sino en la prevención de fallos, detección de regresiones y a desplegar tus aplicaciones con mayor confianza.","Pre-requisitos a instalar: Docker y Git."],schedule:"Viernes 12:00-14:00",track:"DevOps",twitter:["https://twitter.com/phpulpocon/status/1674401667188400129"]},n={title:"Dagster",speaker:[{image:"julien.jpg",name:"Julien Vantyghem",link:"https://twitter.com/JulienVantyghem"},{image:"david-fernandez.jpg",name:"David Fernández Calle",link:"https://www.linkedin.com/in/davidfernandezcalle/"}],description:[""],schedule:"Viernes 12:00-14:00",track:"Data",twitter:["https://twitter.com/phpulpocon/status/1679035108551008257"]},r={title:"TBC",speaker:[{image:"ricard-clau.jpg",name:"Ricard Clau",link:"https://twitter.com/ricardclau"}],description:["TBD"],schedule:"Viernes 16:00-18:00",track:"Management",twitter:["https://twitter.com/phpulpocon/status/1674055466840649731"]},o={title:"Micro-frontends: Divide the monolith and conquer",speaker:[{image:"yahima.jpg",name:"Yahima Duarte Perez",link:"https://twitter.com/layahi82"}],description:["Hoy en día, las aplicaciones se han vuelto increíblemente grandes y complejas, y la mayor parte son desarrolladas del lado del cliente. Se está volviendo muy difícil mantener esas aplicaciones y, a menudo, creamos más errores de los que arreglamos. En esta presentación, exploraremos los conceptos clave y beneficios de la arquitectura micro-frontend y discutiremos cómo se puede implementar en la práctica, cuando vale la pena usarla y que buenas practicas podriamos seguir al implementarla incluyendo una demo corta de como la he implementado yo en experiencias pasadas."],schedule:"Viernes 9:30-10:15",track:"La Pulpito",twitter:["https://twitter.com/phpulpocon/status/1676192556470738949"]},s={title:"Ana Carmona",speaker:[{image:"ana-carmona.jpg",name:"Ana Carmona",link:"https://twitter.com/nhan_bcn"}],description:["-"],schedule:"Viernes 9:30-11:30",track:"Crafter",twitter:["https://twitter.com/phpulpocon/status/1669421244314275866"]},c={title:"Legacy Code: Guia de supervivencia",speaker:[{image:"javier-chacana.jpg",name:"Javier Chacana",link:"https://twitter.com/jchacana"}],description:["Haremos un repaso rápido por distintas técnicas de supervivencia y cómo aplicarlas para reducir riesgo y frustración, ejemplificando en una base de código real (o que luce como una real). Intentaré que no sean ejemplos de laboratorio. Ideal para gente que ha trabajado sólo en proyectos greenfield o para gente que llega a apagar fuegos."],schedule:"Viernes 12:00-14:00",track:"Crafter",twitter:["https://twitter.com/phpulpocon/status/1686764003467411456"]},l={"miguel-lucia":e,"anastasia-kondratieva":a,"mavi-jimenez":t,"imma-valls":i,"julien-david":n,"ricard-clau":r,"yahima-duarte":o,"ana-carmona":s,"javier-chacana":c};export{l as w};
